internal class Program
{
    private static void Main(string[] args)
    {
        Console.WriteLine("Hello, World!");
        StudentList();
    }

    private static void StudentList()
    {
        var Students = new List<Student>
        {
            new (){name = "Ivan Vladimirov", grade = 5.65},
            new (){name = "Petur Stoyanov", grade = 4.98},
            new (){name = "Borislav Terziev", grade = 5.32},
            new (){name = "Khrum Asparuhov", grade = 5.98}
        };
        
        Console.WriteLine("Enter sorting criteria or end program:");
        Console.WriteLine("Commands: DisplayNames, ByName, ByGrade, GradeAverage, end");
        string input = Console.ReadLine();
        while (input != "end")
        {
            
            if (input == "DisplayNames")
            {
                DisplayNames(Students);
            }
            else if (input == "ByName")
            {
                Students.Sort();
                DisplayNames(Students);
            }
            else if (input == "ByGrade")
            {
                Students.Sort((stud1,stud2)=> stud2.grade.CompareTo(stud1.grade));
                DisplayNames(Students);
            }
            else if (input == "GradeAverage")
            {
                AverageGrade(Students);           
            }
            
            
            input = Console.ReadLine();
        }

        
        DisplayNames(Students);


        
    }

    static void DisplayNames(List<Student> Students)
    {
        foreach (Student student in Students)
        {
            Console.WriteLine(student.name + " " + student.grade);
        }
    }

    static void AverageGrade(List<Student> Students)
    {
        double sum = 0;
        for (int i = 0; i < Students.Count; i++)
        {
            sum += Students[i].grade;
        }

        sum /= Students.Count;
        Console.WriteLine($"The average class grade is {sum:f2}");
    }

    public class Student : IComparable
    {
        public string name { get; set; }
        public double grade { get; set; }

        public int CompareTo(object? obj)
        {
            if (obj == null)
            {
                throw new NullReferenceException();
            }
            return this.name.CompareTo(((Student)obj).name);
        }
    }

}

